import React from 'react';

class VerkaufstellenAuflisten extends React.Compnent{

    constructor(props){
        super(props);
        this.state = {
            stationsJS: [],
            isLoaded: false
        }
    }

    componentDidMount(){
        fetch('http://127.0.0.1:5000/api').then(
            response => response.json()).then(
                json => {
                    this.setState({
                        stationsJS: json,
                        isLoaded: true
                    })
                }
            )
    }
}
